uniform sampler2D A;
uniform sampler2D B;

uniform vec2 s_c;
uniform vec2 d_C;
uniform vec2 s_C;

uniform vec2 d_a;
uniform vec2 d_b;

void main() {
    ivec2 p_C = convert_position_i(gl_FragCoord.xy, s_c, s_C, d_C);

    int m = p_C.x;
    int n = p_C.y;

    float v = 0.0;

    for (int k = 0; k < 162; k++) {
        float v_a = texture2D(A, fract((vec2(k, m) + 0.5) / d_a)).r;
        float v_b = texture2D(B, fract((vec2(n, k) + 0.5) / d_b)).r;

        v += v_a * v_b;
    }

    gl_FragColor = vec4(v, 0, 0, 0);
}

