uniform vec2 s_im;
uniform vec4 d_Im;
uniform vec4 s_Im;

uniform int C1;
uniform int H1;
uniform int W1;
uniform int KH;
uniform int KW;
uniform int DH;
uniform int DW;
uniform int SH;
uniform int SW;
uniform int PH;
uniform int PW;

void main() {
    ivec4 p_Col = convert_position_i(gl_FragCoord.xy, s_col, s_Col, d_Col);

    int n  = p_Col.x;
    int h2 = p_Col.y;
    int w2 = p_Col.z;
    int khkwc1 = p_Col.w;
    int kh = khkwc1 / C1 / KW;
    int kw = khkwc1 / C1 - kh * KW;
    int c1 = khkwc1 - (kh * KW + kw) * C1;

    int h1 = h2 * SH - PH + kh * DH;
    int w1 = w2 * SW - PW + kw * DW;

    float v = (h1 < 0 || h1 >= H1 || w1 < 0 || w1 >= W1) ? 0.0 : texture2D(im, convert_coord(vec4(n, h1, w1, c1) + 0.5, s_Im, s_im, d_im)).r;

    gl_FragColor = vec4(v, 0, 0, 0);

}

